import React from 'react'

class Footer extends React.Component {

    render() {
        return (
            <footer class='container mt-4 navbar bg-dark' style={{width: "100%"}}>
                <div class='row'>
                    <div class='col'>
                        <p class='text-center'>info info info</p>
                    </div>
                </div>
            </footer>
        )
    }
}

export default Footer;
